import logo from './logo.svg';
import './pico-master/css/pico.css';

function App() {
  return (
    <div>

        <h3>
          Laab es una aplicacion web <code>/React JS</code> que utiliza el poder del motor BPM
                                     <code>/Camunda</code> para gestionar los procesos del laboratorio.
        </h3>
       <h1>Laab v1 - By H4ndshake</h1>

    </div>
  );
}

export default App;
